import React from 'react'
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Typography from '@mui/material/Typography';
import { Button, CardActionArea, CardActions } from '@mui/material';
import { typography } from '@mui/system';

const Product = () => {
// create array of objects these are our products
  const products = [
                    {name:"Blood Moon", Description: " berries, spice, and life", Id: 9165, Price:"$3.25", PriceLarge: '$8.99'},
                    {name:"Holiday", Description: "Yellow energy from the sun ", Id:4728, Price:"$3.25", PriceLarge: '$8.99'},
                    {name:"Abundant Earth", Description: " Green is clean", Id:32416 , Price:"$3.25", PriceLarge: '$8.99'},
                    {name:"Seasonal", Description: " Cylce of variables", Id: 71177, Price:"$3.25", PriceLarge: '$8.99'},

                  ]
  return (
    <>
    <card sx={{ maxWidth: 345 }}>
      <CardActionArea>
        <CardMedia
          component="img"
          height="140"
          image="https://cdn.shopify.com/s/files/1/0282/3110/6659/products/1TheKombuchaShop2ndShoot-113_5cf37d9b-035a-43a2-8cc3-b10a623c9b6c_1920x.jpg?v=1574540144"
          alt="kombucha Blood Moon"
        />
        <CardContent>
          <typography gutterBottom variant="h5" component="div">
            Our most popular Item. Blood Moon Kombucha offers revitalization, healing, and energy
          </typography> 
        </CardContent>

      </CardActionArea>
      
    </card>

      
    </>
  )
}

export default Product
